import React from "react";

const Player = ({ isPlaying }) => {
    return (

        <footer className="py-4 text-white-50 fixed-bottom player">
            <i className="fas fa-angle-double-left left-button fa-2x"></i>
            {console.log(isPlaying)}
            {!isPlaying ?

                <i className="far fa-play-circle play-button-list fa-3x play-button"></i> :
                <i className="far fa-pause-circle fa-3x play-button"></i>
            }
            <i className="fas fa-angle-double-right right-button fa-2x"></i>
        </footer>
    )
}

export default Player;
